INSERT INTO `help_center` (`hc_id`, `hc_title`, `hc_decription`, `hc_status`) VALUES
(1, 'HOW TO INSERT NEW ITEM', '<ul>\n<li>Go to "New Stocks" in your inventory management system.</li>\n<li>Select a supplier for the new product.</li>\n<li>Search for or select the product using its code or name.</li>\n<li>Enter the product details such as name, description, price, etc.</li>\n<li>Add the product to the list of items in delivery instead of the inventory by clicking "Add to Delivery".</li>\n<li>Repeat steps 3-5 for all new products.</li>\n<li>Double-check the details of the list of new products in the delivery.</li>\n<li>Submit the list of new products to be added to the inventory by clicking "Submit" or "Add to Inventory".</li>\n<li>Verify that the new products have been successfully added to your inventory.</li>\n</ul>\n<p>\nIn summary, the modified process involves adding the new products to the list of items in delivery, double-checking the details, and submitting the list to be added to the inventory. This can help ensure that any errors or omissions are caught before the products are added to the inventory.\n</p>', 0),
(2, 'HAHAHAHAHA', '<ul>\r\n<li>Go to "New Stocks" in your inventory management system.</li>\r\n<li>Select a supplier for the new product.</li>\r\n<li>Search for or select the product using its code or name.</li>\r\n<li>Enter the product details such as name, description, price, etc.</li>\r\n<li>Add the product to the list of items in delivery instead of the inventory by clicking "Add to Delivery".</li>\r\n<li>Repeat steps 3-5 for all new products.</li>\r\n<li>Double-check the details of the list of new products in the delivery.</li>\r\n<li>Submit the list of new products to be added to the inventory by clicking "Submit" or "Add to Inventory".</li>\r\n<li>Verify that the new products have been successfully added to your inventory.</li>\r\n</ul>\r\n<p>\r\nIn summary, the modified process involves adding the new products to the list of items in delivery, double-checking the details, and submitting the list to be added to the inventory. This can help ensure that any errors or omissions are caught before the products are added to the inventory.\r\n</p>', 0);
